(5, 'August 2020 | Hospitality &amp; Travel Connaisseur Magazine', 'The Debut issue of Hospitality &amp; Travel Connaisseur Magazine.', '<h1><span xss=removed><b xss=removed>The Debut issue of Hospitality & Travel Connaisseur Magazine.</b></span></h1><h3><span xss=removed>Explore Happenings of Hospitality <b>under one-roof</b>. Hospitality <a href=\"https://community.hospitalityconnaisseur.com/category/news/\" target=\"_blank\">News</a>, <a href=\"https://community.hospitalityconnaisseur.com/category/learn-from-leaders/\" target=\"_blank\">Interviews </a>& <a href=\"https://community.hospitalityconnaisseur.com/category/magazine/\" target=\"_blank\">Stories</a>. The issue of August-2020.</span></h3><p><span xss=removed><br></span></p><h4><span xss=removed>Now... What\'s in it for you?</span></h4><ul><li><span xss=removed>Explore a first-of-its kind of initiative on Health, Hygiene and Safety by ITC Hotels.</span></li><li><span xss=removed>Explore one of the oldest and experienced company engaged in Manufacturing and Supplying of Flora Sticks for Hospitality Brands.</span></li><li><span xss=removed>ITC Grand Goa - A luxury collection of Resort and Spa reopens by Adopting \'We Assure\' - A responsible luxury initiative.</span></li><li><span xss=removed>An Informative study on Single-Use Plastic and Tourism!</span></li><li><span xss=removed>The Niraamaya Wellness Retreats introduces Integrative and Functional Medicine Programs by Daivam Wellness.</span></li><li><span xss=removed>Do Explore a Curated Travelopedia of JAPAN - A mythical country of diligent people.</span></li><li><span xss=removed>Get to know \'TOP 15 SOFT-SKILLS to master as a Hospitality Professional\'</span></li><li><span xss=removed>Exclusive Interview with Mr. Prithvi Roy, Assistant Professor of Front Office at WGSHA.</span></li><li><span xss=removed>ITC Hotels expends its responsible dining outreach across India with Zomato partnership.</span></li></ul>', '[]', 'english', 3, 4, '[3]', '[]', 0, NULL, 0, NULL, 1, NULL, '', 1618358400, NULL, 'magazine', 0, NULL, 1, 'active', '', 'ITC Hotels,Hospitality Connaisseur,E-Magazine,Hotel Management,Golden Aromatics ,Travel Magazine,Travel Japan,Japan data,Japan History,Hospitality and Travel,ITC Grand Goa,Goa Hotels,Single Use Plastic,Save Planet,Hotel Magazine,Hospitality and Travel Connaisseur Magazine', 'Explore Happenings of Hospitality under one-roof. Hospitality News, Interviews & Stories. The issue of August-2020.', 1);
