INSERT INTO `faqs` (`id`, `question`, `answer`, `status`) VALUES
(1, 'sample quest?', 'sjdbjhsgdbaj', 0),
(2, 'What is Hotel Management?', 'While you may have stayed in several hotels before, but... you may have never wondered, What is hotel management? Well, Hospitality Management is a broader, more general definition that covers hotel management as well as management at other businesses that provide services such as food and beverage, travel, and other businesses that serve both vacation and business travelers.\r\n\r\nWhile hotel management programs may focus mainly on how to manage a hotel, and its departments, and its staff, hospitality management courses may branch out into food services, travel, and business management courses.', 1),
(3, 'What is Hospitality Connaisseur?', 'Hospitality Connaisseur  Accelerating Hospitality, Empowering Hoteliers. Indias 1st Hospitality centric Media and Technology Company, believes to connect each hospitality individual to the vast & various amount of knowledge by providing Boost, Backup and Motivation for their professional growth journey via Online Courses, Magazines, Podcasts, News and Daily relevant Articles on The Hospitality Industry. Start learning the modern way!\r\n\r\nMission: To be the Souvenir for our Hospitality Industry with the Finest Informative Content.\r\nVision: To be the Premium Real-time Educational Source of Indian Hotel & Tourism Industry by providing remarkable profit to our Subscribers and Clients.', 1),
(4, 'What are some typical Hospitality Management Courses?', 'Whether youre planning on pursuing an associates or a bachelors degree in hospitality management, your courses will vary from program to program. Some hospitality management courses you may take in order to earn an associates degree in hospitality management include: Fundamental Hospitality Management Principles, Technology in the Hospitality Management Industry, Convention and Event Management, Accounting Principles, Employment Law or A bachelor degree program may also teach you the fundamentals, but also move into more technical or specific areas of hospitality management. Some courses you may take in order to earn a bachelors degree in hospitality management includes Integrated Marketing Communications, Applied Business Ethics, Hospitality Law & Legal Issues, Applied Accounting and Finance, with Integrated Marketing Communications.', 1),
(5, 'What Courses does www.hospitalityconnaisseur.com offer?', 'Well, Hospitality Connaisseur is a Total Solution for your knowledge needs! We cover Hotel Management, Tourism Management and Aviation Management with their syllabus converted into knowledge enriched Online Courses (Videos). Our Online Courses are not just another online courses! We are Industry Experts, bring you the most relevant Online Courses made with the help of Edutainment, which is a mix of Education & Entertainment. Our Courses wont bore you! If you had a hard working day or a boring college day, Get into our Curated and Comprehensive online courses and calm your appetite for knowledge. We simply provide Digitally Comprehensive Learning & Development with Effective Training Management.', 0),
(6, 'What Courses does www.hospitalityconnaisseur.com offer?', 'Well, Hospitality Connaisseur is a Total Solution for your knowledge needs! We cover Hotel Management, Tourism Management and Aviation Management with their syllabus converted into knowledge enriched Online Courses (Videos). Our Online Courses are not just another online courses! We are Industry Experts, bring you the most relevant Online Courses made with the help of Edutainment, which is a mix of Education & Entertainment. Our Courses wont bore you! If you had a hard working day or a boring college day, Get into our Curated and Comprehensive online courses and calm your appetite for knowledge. We simply provide Digitally Comprehensive Learning & Development with Effective Training Management.\r\n\r\nWe have a collection of Free and Paid Courses to choose from. You can also find Courses made by Top Hospitality Faculties and Mentors, to learn from their perspective! You can also explore community.hospitalityconnaisseur.com to get a free knowledgebase, which has Relevant Articles, Podcasts and Latest NEWS on Indian Hospitality Segment.\r\n\r\nMoreover, We also publish a Monthly Hospitality centric Magazine called Hospitality & Travel Connaisseur Magazine ; An E-Magazine, brings you the trends of Hotel, Tourism and Aviation Industry with Detailed Industry Insights. News | Interviews | Stories at the most affordable price!', 1);
