(10, 'terms_and_condition', '<span id=\"docs-internal-guid-72f671f6-7fff-79c6-603d-5c31e7495167\"><h1 xss=\"removed\"><span xss=\"removed\">WEBSITE Terms & Conditions.</span></h1>\r\n<div xss=\"removed\"><span xss=\"removed\"><br></span></div>\r\n<div><span xss=\"removed\"><span xss=\"removed\" id=\"docs-internal-guid-c1daf63e-7fff-8eac-78dc-31a497e5b199\"><h3 xss=\"removed\"><span xss=\"removed\">Updated : 12 April, 2021</span></h3>\r\n    <h3 xss=\"removed\"><span xss=\"removed\"><br></span></h3>\r\n    <p xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\" id=\"docs-internal-guid-bd24ea88-7fff-0a74-e4cd-2ec0cf8e3313\">CONNAISSEUR FUTURETECH PRIVATE LIMITED, of Surat, Gujarat, India (referred to as Company, we or us), provides the HospitalityConnaisseur.com The Website located at www.hospitalityconnaisseur.com and their all subdomains - mobile and desktop apps (collectively, the Website), subject to your compliance with all the terms, conditions and notices contained or referenced herein (the, Policy). In addition, when subscribing or buying the certain services from the Website, users will be subject to additional rules applicable to such services.</span></span>\r\n    </p>\r\n    <p></p>\r\n    <div xss=\"removed\"><br></div><span xss=\"removed\"><div xss=\"removed\"><b xss=\"removed\">BY USING THE WEBSITE, YOU INDICATE THAT YOU ACCEPT THE POLICY AND THAT YOU AGREE TO ABIDE BY IT. YOUR REMEDY FOR DISSATISFACTION WITH THE WEBSITE OR ITS CONTENTS IS TO STOP USING THE WEBSITE.</b></div></span>\r\n    <p></p>\r\n    <p xss=\"removed\"><span xss=\"removed\"><b><br></b></span></p>\r\n    <h3 xss=\"removed\"><span xss=\"removed\">1. ACCESSING THE WEBSITE</span></h3>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">You are responsible for making all arrangements necessary for you to have access to the Website. We reserve the right to withdraw or amend the Website, and any service or material that we provide on the Website, in our sole discretion and without notice to you. We will not be liable if, for any reason, all or any part of the Website is unavailable at any time or for any period.</span></p>\r\n    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n        <h3 xss=\"removed\"><span xss=\"removed\">2. INTELLECTUAL PROPERTY RIGHTS (IPR)</span></h3>\r\n        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">(a) The Website and their entire contents, features and functionality (including but not limited to all information, software, text, displays, images, video and audio, and the design, selection and arrangement thereof) are owned by the Company, its licensors or other providers of such material, and are protected by Indian IPR and International copyright, trademark, patent, trade secret and other intellectual property or proprietary rights laws. This Policy permits you to use the Website for your non-commercial use only. No right, title or interest in or to the Website or any content on the Website is transferred to you, and all rights not expressly granted, are reserved by the Company. The royalty free materials are often credited by us to its creators as a form of respect.</span></p>\r\n        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">(b) You must not reproduce, distribute, modify, create derivative works of, publicly display, publicly perform, republish, download, store or transmit any of the material on the Website, except as follows: (i) You may store files that are automatically cached by your Web browser for display enhancement purposes; (ii) if we provide desktop, mobile or other applications/websites for download, you may download a single copy to your computer or mobile device solely for your own personal, non-commercial use, provided you agree to be bound by an applicable end user license agreement for such applications; and (iii) if we provide social media features at any time, you may take such actions as are enabled by such features.</span></p>\r\n            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\" id=\"docs-internal-guid-783c8dfb-7fff-69d0-c589-2edb1dfc9132\"><br></b></span></p>\r\n                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">(c) You may not: (i) use any illustrations, photographs, video or audio sequences or any graphics separately from the accompanying text; or (ii) delete or alter any copyright, trademark or other proprietary rights notices from copies of materials from the Website; or (iii) access or use for any commercial purposes any part of the Website or any services or materials available through the Website.</span></p>\r\n                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">(d) The Company name, the Company logo, and all related names, logos, product and service names, designs and slogans, are trademarks of the Company or its affiliates or licensors. You may not use such marks without the prior written permission of the Company. All other names, logos, product and service names, designs and slogans on the Website are the trademarks of their respective owners.</span></p>\r\n                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n                        <h3 xss=\"removed\"><span xss=\"removed\">3</span><span xss=\"removed\">. </span><span xss=\"removed\">YOUR OBLIGATIONS AND REPRESENTATIONS</span></h3>\r\n                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\" id=\"docs-internal-guid-d442f9be-7fff-e7d5-2c1c-1b7eacb79d25\"><br></b></span></p>\r\n                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">(a) You may use the Website only for lawful purposes and in accordance with this Policy.</span></p>\r\n                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">(b) You promise that: (i) you are of legal age to form a binding contract with the Company; (ii) you will not use the Website in any way that violates any applicable local or international law or regulation; (iii) you will not send, knowingly receive, upload, download, use or re-use any material which does not comply with the Content Standards (defined below); (iv) you will not impersonate or attempt to impersonate the Company, a Company employee, another user or any other person or entity; (v) you will not do anything that could disable, overburden, damage, or impair the Website or interfere with any persons use of the Website; (vi) you will not use any robot, spider or other automatic device, process or means to access the Website for any unlawful purpose or in violation of this Policy; (vii) you will not introduce any viruses, trojan horses, worms, logic bombs or other material which is malicious or technologically harmful; and (viii) you will not co-brand or frame the Website or hyper-link to it without the express prior written permission of an authorized representative of the Company.</span></p>\r\n                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n                            <h3 xss=\"removed\"><span xss=\"removed\">4. USER CONTRIBUTIONS or GUEST CONTRIBUTORS</span></h3>\r\n                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\" id=\"docs-internal-guid-35dd773f-7fff-2fac-cfd5-aadb550b741b\"><br></b></span></p>\r\n                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">(a) We may from time-to-time provide interactive services such as share features (collectively, Interactive Services) that allow users to post, submit, publish, display or transmit to other persons (hereinafter, post) content or materials (collectively, User Contributions) on or through the Website. All User Contributions must comply with the Content Standards set out in this Policy. The Contributions are subject to change and applicable on our Websites and in the Magazines.</span></p>\r\n                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">(b) Any User Contribution that you post will be considered non-confidential and non-proprietary, to the extent permitted by law. By providing a User Contribution, you grant the Company and its successors the right to use, reproduce, modify, perform, display, distribute and otherwise disclose to third parties any such material. You promise that you own or control all rights in and to the User Contributions and have the right to grant such license to us. You agree that you will have no claim or other recourse against the Company for infringement of any proprietary right with respect to your User Contributions. You acknowledge and agree that you waive any moral (or similar) rights that you may have in any territory in respect of User Contributions, including but not limited to, the right to be attributed as the author of the User Contributions.</span></p>\r\n                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">(c) If you provide a User Contribution to be transmitted to other users of the Website or any third parties, you accept that your User Contributions are posted on and transmitted to others at your own risk. Additionally, we cannot control the actions of other users of the Website or any third parties with whom you may choose to share your User Contributions. Therefore, we cannot and do not guarantee that your User Contributions will not be viewed by unauthorized persons.</span></p>\r\n                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">(d) User Contributions must be accurate and comply with all the applicable laws in the country from which they are posted. You understand and acknowledge that you are responsible for any User Contributions you submit or contribute, and you, not the Company, have full responsibility for such content, including its legality, reliability, accuracy and appropriateness. We are not responsible, or liable to any third-party, for the content or accuracy of any User Contributions posted by you or any other user of the Website.</span></p>\r\n                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n                                            <h3 xss=\"removed\"><span xss=\"removed\">5. CONTENT STANDARDS</span></h3>\r\n                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\" id=\"docs-internal-guid-b072689f-7fff-da0d-cc48-2915c97830f9\"><br></b></span></p>\r\n                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">These content standards apply to all User Contributions / Guest Contributors / Hospitality Influencers and use of Interactive Services, if offered. User Contributions must in their entirety comply with all the applicable local and international laws and regulations.</span></p>\r\n                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Without limiting the foregoing, User Contributions must not: Contain any material that is defamatory, obscene, indecent, abusive, offensive, harassing, violent, hateful, inflammatory or otherwise objectionable, Promote sexually explicit or pornographic material, violence, or discrimination based on race, sex, religion, nationality, disability, sexual orientation or age Infringe any patent, trademark, trade secret, copyright or other intellectual property or other rights of any third-party Infringe the legal rights (including the right of publicity and privacy) of others or contain any material that could give rise to any civil or criminal liability under applicable laws, Promote any illegal activity, or advocate, promote or assist any unlawful act, Cause annoyance, inconvenience or needless anxiety or be likely to upset, embarrass, alarm or annoy any other person, Impersonate any person, or misrepresent your identity or affiliation with any person or organization Involve commercial activities or sales, Be likely to deceive or give the impression that they emanate from or are endorsed by us, or any other person or entity.</span></p>\r\n                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                    <h3 xss=\"removed\"><span xss=\"removed\">6. MONITORING AND ENFORCEMENT; TERMINATION</span></h3>\r\n                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We have the right, but not the obligation, to review, screen or edit any User Contribution / Content of Guest Contributors and Hospitality Influencers. You accept that such contributions do not reflect the views of the Company and are not endorsed by the Company.</span></p>\r\n                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We have the right to: (a) take any action with respect to the User Contributions that we deem necessary or appropriate; (b) take appropriate legal action, including without limitation, referral to law enforcement, for any illegal or unauthorized use of the Website; (c) terminate or suspend your access to all or part of the Website; (d) We may edit the content of Guest Contributors and Hospitality Influencer to enhance its appearance and impact on the people of hospitality industry.</span></p>\r\n                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Without limiting the foregoing, we have the right to fully cooperate with law enforcement authorities requesting or directing us to disclose the identity or other information of anyone posting any materials on or through the Website. We do not undertake to review material before it is posted on the Website, and cannot ensure prompt removal of objectionable material after it has been posted.</span></p>\r\n                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Accordingly, we assume no liability for any action or inaction regarding transmissions, communications or content provided by any user or third-party. We have no liability or responsibility to anyone for performance or nonperformance of the activities described in this section.</span></p>\r\n                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                    <h3 xss=\"removed\"><span xss=\"removed\">7. COPYRIGHT INFRINGEMENT</span></h3>\r\n                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We take claims of copyright infringement seriously. We will respond to notices of alleged copyright infringement where appropriate. If you believe any materials accessible on or from the Website infringe your copyright, you may request removal of those materials (or access thereto) from the Website by submitting written notification to </span>\r\n                                                                        <a class=\"text-theme\" href=\"mailto:support@hospitalityconnaisseur.com\" xss=\"removed\"><span xss=\"removed\">support@hospitalityconnaisseur.com</span></a><span xss=\"removed\"> ; In accordance with the proper copyright act, the written notice, may include substantially the following:</span></p>\r\n                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Your physical or electronic signature.</span></p>\r\n                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Identification of the copyrighted work, you believe to have been infringed or, if the claim involves multiple works on the Website, a representative list of such works.</span></p>\r\n                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Identification of the material you believe to be infringing, in a sufficiently precise manner to allow us to locate that material.</span></p>\r\n                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Adequate information by which we can contact you (including your name, postal address, telephone number and e-mail address).</span></p>\r\n                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">A statement that you have a good faith belief that use of the copyrighted material is not authorized by the copyright owner, its agent or the law.</span></p>\r\n                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">A statement that the information in the written notice is accurate.</span></p>\r\n                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Please be aware that if you knowingly misrepresent that material or activity on the Website is infringing your copyright, you may be held liable for damages (including costs and legal fees).</span></p>\r\n                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">COUNTER-NOTIFICATION PROCEDURES. If you believe that material you posted on the Website was removed or access to it was disabled by mistake or misidentification, you may file a counter-notification with us by simply emailing us on </span>\r\n                                                                                        <a class=\"text-theme\" href=\"mailto:support@hospitalityconnaisseur.com\" xss=\"removed\"><span xss=\"removed\">support@hospitalityconnaisseur.com</span></a><span xss=\"removed\"> ; The Counter-Notice may include substantially the following:</span></p>\r\n                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Your physical or electronic signature.</span></p>\r\n                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">An identification of the material that has been removed or to which access has been disabled and the location at which the material appeared before it was removed or access disabled.</span></p>\r\n                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Adequate information by which we can contact you (including your name, postal address, telephone number and e-mail address).</span></p>\r\n                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">A statement under penalty of perjury by you that you have a good faith belief that the material identified above was removed or disabled as a result of a mistake or misidentification of the material to be removed or disabled.</span></p>\r\n                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">A statement that you will consent to local District Court jurisdiction, or if overseas, to an appropriate judicial body.</span></p>\r\n                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">May take upto 15 business days to process and understand your request.</span></p>\r\n                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                            <h3 xss=\"removed\"><span xss=\"removed\">8. TRUST ON INFORMATION POSTED</span></h3>\r\n                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">The information presented on or through the Website is made available solely for general information purposes and to work on our Mission, Vision and Core Philosophy. We do not make any statements regarding the accuracy, completeness or usefulness of this information. Any reliance you place on such information is strictly at your own risk. The Website includes content provided by third parties, including materials provided by other users and third-party licensors and universities. We are not responsible, or liable to you or any third-party, for the content or accuracy of materials provided by any third parties. For more information or concerns, please contact us on </span>\r\n                                                                                                <a class=\"text-theme\" href=\"mailto:support@hospitalityconnaisseur.com\" xss=\"removed\"><span xss=\"removed\">support@hospitalityconnaisseur.com</span></a>\r\n                                                                                            </p>\r\n                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                               