 SERVICE, paper contract, or other stated terms, depending on the type of product/service/subscription you are using or purchasing.</span></p>\r\n                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n                                                                                                <h3 xss=\"removed\"><span xss=\"removed\">11. LINKS FROM THE WEBSITE</span></h3>\r\n                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\" id=\"docs-internal-guid-628db861-7fff-f4b9-b62d-15b17c86c62a\"><br></b></span></p>\r\n                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">If the Website contains links to other sites and resources provided by third parties, these links are provided for your convenience only. We have no control over the contents of those sites or resources, and accept no responsibility for them or for any loss or damage that may arise from your use of them. If you decide to access any third-party websites linked to the Website, you do so entirely at your own risk and subject to the terms and conditions of use for such third-party websites.</span></p>\r\n                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                    <h3 xss=\"removed\"><span xss=\"removed\">12. LINKING TO THE WEBSITE AND SOCIAL MEDIA FEATURES</span></h3>\r\n                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n     