us on </span>\r\n                                                                                                                                <a class=\"text-theme\" href=\"mailto:support@hospitalityconnaisseur.com\" xss=\"removed\"><span xss=\"removed\">support@hospitalityconnaisseur.com</span></a>\r\n                                                                                                                            </p>\r\n                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                            <h3 xss=\"removed\"><span xss=\"removed\">14. LIMITATION OF LIABILITY</span></h3>\r\n                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">TO THE MAXIMUM EXTENT PERMITTED BY LAW, IN NO EVENT SHALL THE COMPANY, ITS LICENSORS, AFFILIATES, EMPLOYEES, AGENTS, OFFICERS OR DIRECTORS BE LIABLE TO YOU OR ANY THIRD-PARTY FOR ANY SPECIAL, PUNITIVE, INCIDENTAL, INDIRECT OR CONSEQUENTIAL DAMAGES OF ANY KIND, OR ANY DAMAGES WHATSOEVER, INCLUDING, WITHOUT LIMITATION, THOSE RESULTING FROM LOSS OF USE, LOSS OF DATA, OR LOSS OF PROFITS, WHETHER OR NOT WE HAVE BEEN ADVISED OF THE POSSIBILITY OF SUCH DAMAGES, AND ON ANY THEORY OF LIABILITY, ARISING OUT OF OR IN CONNECTION WITH THE USE OF THE WEBSITE OR OF ANY WEBSITE REFERENCED OR LINKED TO FROM OUR WEBSITE. YOU WILL BE RESPONSIBLE FOR ALL CLAIMS AND DAMAGES RESULTING FROM THE MISUSE OF THE WEBSITE BY YOU.</span></p>\r\n                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                <h3 xss=\"removed\"><span xss=\"removed\">15. CHANGES</span></h3>\r\n                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We reserve the right, in our sole discretion, to change the terms of this Policy at any time. Any changes are effective immediately upon posting to the Website. Your continued use of the Website constitutes your agreement to all such terms and conditions. The updation notice may be, or may not be sent to you on your registered email for information purposes.</span></p>\r\n                                                                                                                                <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                    <h3 xss=\"removed\"><span xss=\"removed\">16. EQUITABLE RELIEF</span></h3>\r\n                                                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">You acknowledge that a breach of any confidentiality or proprietary rights provision of this Policy may cause the Company irreparable damage, for which the award of damages would not be adequate compensation. Consequently, the Company may institute an action to enjoin you from any and all acts in violation of those provisions, which remedy shall be cumulative and not exclusive, and the Company may seek the entry of an injunction enjoining any breach or threatened breach of those provisions, in addition to any other relief to which the Company may be entitled at law or in equity.</span></p>\r\n                                                                                                                                    <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                        <h3 xss=\"removed\"><span xss=\"removed\">17. GOVERNING LAW AND VENUE</span></h3>\r\n                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">If you are a Website user in a member country of the European Economic Area (EEA) or European Union (EU)), this Policy and the relationship between you and us shall be governed by the laws of the EU/EEA member state in which you are domiciled. We believe in Sharing knowledge and information, although your data is protected with us as we do not sell it and only use it for our own marketing purposes. For any specific query, please write us on </span>\r\n                                                                                                                                            <a class=\"text-theme\" href=\"mailto:support@hospitalityconnaisseur.com\" xss=\"removed\"><span xss=\"removed\">support@hospitalityconnaisseur.com</span></a>\r\n                                                                                                                                        </p>\r\n                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                        <h3 xss=\"removed\"><span xss=\"removed\">18. SEVERABILITY</span></h3>\r\n                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">If any provision of this Policy is held by a court of competent jurisdiction to be contrary to law, such provision shall be changed and interpreted so as to best accomplish the objectives of the original provision to the fullest extent allowed by the law and the remaining provisions of this Policy will remain in full force and effect.</span></p>\r\n                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><b xss=\"removed\"><br></b></span></p>\r\n                                                                                                                                            <h3 xss=\"removed\"