                                                                                                                                 <p xss=\"removed\"><b xss=\"removed\"><br></b></p>\r\n                                                                                                                                                        <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">This Policy, together with the documents expressly referred to herein, constitutes the sole and entire agreement between you and the Company with respect to the Website and supersedes all the prior and contemporaneous understandings, agreements, representations and warranties, both written and oral, with respect to the Website or Websites.</span></p>\r\n                                                                                                                                                        <p xss=\"removed\"><b xss=\"removed\"><br></b></p>\r\n                                                                                                                                                            <h3 xss=\"removed\"><span xss=\"removed\">23. YOUR COMMENTS AND CONCERNS</span></h3>\r\n                                                                                                                                                            <p xss=\"removed\"><b xss=\"removed\"><br></b></p>\r\n                                                                                                                                                            <p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">The Website is operated by Hospitality Connaisseur (Connaisseur Futuretech Private Limited). If you have any questions, please contact us via email at </span>\r\n                                                                                                                                                                <a class=\"text-theme\" href=\"mailto:support@hospitalityconnaisseur.com\" xss=\"removed\"><span xss=\"removed\">support@hospitalityconnaisseur.com</span></a><span xss=\"removed\"> ; If you want to send us notices or service of process, Please do email us for the same and the concerned person will revert you within 15 business days.</span></p>\r\n                                                                                                                                                            <p xss=\"removed\"><b xss=\"removed\"><br></b></p>\r\n                                                                                                                                                                <h4 xss=\"removed\"><span xss=\"removed\">We Thank You for believing in us and visiting our Website. Whatever we do. We do it with passion and for the betterment of the people of the Hospitality Industry by making their lives easier and by providing trusted and informative content. Thats why we are Hospitality Connaisseur.</span></h4>\r\n                                                                                                                                                                <p xss=\"removed\"><br></p>\r\n                                                                                                                                                                    <h4 xss=\"removed\"><span xss=\"removed\">Keep Learning. Keep Growing.</span></h4>\r\n                                                                                                                                                                    </span>\r\n                                                                                                                                                                    </span>\r\n</div>\r\n</span>\r\n<h2></h2>');
