(28, 'heading_line', 'Thought of the day : THE TIME IS ALWAYS RIGHT TO DO THE RIGHT THING.'),
(29, 'refund_policy', '<p><span id=\"docs-internal-guid-469c83f2-7fff-034d-36b9-856408422840\"></span></p>\r\n<h1 xss=\"removed\"><span xss=\"removed\">WEBSITE Refund Policy.</span></h1>\r\n<p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n<p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\"><span xss=\"removed\" id=\"docs-internal-guid-65f85c1b-7fff-236e-cb75-08508f9f6cf1\"></span></span>\r\n</p>\r\n<h3 xss=\"removed\"><span xss=\"removed\">Updated : 12 April, 2021</span></h3>\r\n<h3 xss=\"removed\"><span xss=\"removed\"><br></span></h3>\r\n<p xss=\"removed\"><span xss=\"removed\"><span id=\"docs-internal-guid-17ae3aad-7fff-9b9d-f9bc-6f8f5b0ff815\"><span xss=\"removed\">CONNAISSEUR FUTURETECH PRIVATE LIMITED, of Surat, Gujarat, India (referred to as Company, we or us), provides the HospitalityConnaisseur.com The Website located at www.hospitalityconnaisseur.com and their all subdomains - mobile and desktop apps (collectively, the Website), subject to your compliance with all the terms, conditions and notices contained or referenced herein (the, Policy). In addition, when subscribing or buying the certain services from the Website, users will be subject to additional rules applicable to such services.</span></span>\r\n    </span>\r\n</p>\r\n<p xss=\"removed\"><span xss=\"removed\"><span id=\"docs-internal-guid-17ae3aad-7fff-9b9d-f9bc-6f8f5b0ff815\"><span xss=\"removed\"><br></span></span>\r\n    </span><b><span xss=\"removed\"><span id=\"docs-internal-guid-17ae3aad-7fff-9b9d-f9bc-6f8f5b0ff815\" xss=\"removed\"><span xss=\"removed\"><br></span></span></span><span xss=\"removed\"><span id=\"docs-internal-guid-17ae3aad-7fff-9b9d-f9bc-6f8f5b0ff815\" xss=\"removed\"><span xss=\"removed\"><span id=\"docs-internal-guid-23229a0e-7fff-bb6c-8230-28d453af36ae\" xss=\"removed\"><span xss=\"removed\">BY USING THE WEBSITE, YOU INDICATE THAT YOU ACCEPT THE POLICY AND THAT YOU AGREE TO ABIDE BY IT. YOUR REMEDY FOR DISSATISFACTION WITH THE WEBSITE OR ITS CONTENTS IS TO STOP USING THE WEBSITE.</span></span></span></span></span></b></p>\r\n<p xss=\"removed\"><b><span xss=\"removed\"><span id=\"docs-internal-guid-17ae3aad-7fff-9b9d-f9bc-6f8f5b0ff815\" xss=\"removed\"><span xss=\"removed\"><span id=\"docs-internal-guid-23229a0e-7fff-bb6c-8230-28d453af36ae\" xss=\"removed\"><span xss=\"removed\"><br></span></span></span></span></span></b></p>\r\n<p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Thank you for buying our courses. We ensure that our users have a rewarding experience while they discover, access and purchase our courses and magazines, whether it is Hospitality Influencer-led or Hospitality Connaisseur Original Courses or Magazines.</span></p>\r\n<p xss=\"removed\"><b xss=\"removed\" id=\"docs-internal-guid-9f12cb12-7fff-c5f9-9739-bdc4b7773c43\"><br></b></p>\r\n<p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">As with any online purchase experience, there are terms and conditions that govern the Refund Policy. When you buy a course / magazine on </span>\r\n    <a class=\"text-theme\" href=\"http://www.hospitalityconnaisseur.com\" xss=\"removed\"><span xss=\"removed\">www.hospitalityconnaisseur.com</span></a>\r\n    <span xss=\"removed\">, you agree to our Privacy Policy, Terms & Conditions and Refund policy.</span>\r\n</p>\r\n<p xss=\"removed\"><b xss=\"removed\"><br></b></p>\r\n<h4 xss=\"removed\"><span xss=\"removed\">In Short : We do not provide any refunds to our Subscribers or Buyers, as our offerings are knowledge-led and purely created to enhance the knowledge of the people of the hospitality industry. Kindly Explore our Online Courses and Magazines or other content by paying affordable prices and gain the knowledge as per your field of interest.</span></h4>\r\n<p xss=\"removed\"><b xss=\"removed\"><br></b></p>\r\n<p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Refunds of Duplicate Payment : Refund of the duplicate payment made by the delegate will be processed via the same source (original method of payment) in 15 working days post intimation by the customer or purchaser.</span></p>\r\n<p xss=\"removed\"><b xss=\"removed\"><br></b></p>\r\n<p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">We, Connaisseur Futuretech Private Limited reserves the right to revise the terms & conditions of this policy without any prior notice.</span></p>\r\n<p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">Moreover, Refunds can also take place only in any extreme conditions with decisions taken by the management. Subject to Note.</span></p>\r\n<p dir=\"ltr\" xss=\"removed\"><span xss=\"removed\">The Website is operated by Hospitality Connaisseur (Connaisseur Futuretech Private Limited). If you have any questions, please contact us via email at </span>\r\n    <a class=\"text-theme\" href=\"mailto:support@hospitalityconnaisseur.com\" xss=\"removed\"><span xss=\"removed\">support@hospitalityconnaisseur.com</span></a><span xss=\"removed\"> ; If you want to send us notices or service of process, Please do email us for the same and the concerned person will revert you within 15 business days.</span></p>\r\n<p xss=\"removed\"><b xss=\"removed\"><br></b></p>\r\n<h4 xss=\"removed\"><span xss=\"removed\">We Thank You for believing in us and visiting our Website. Whatever we do. We do it with passion and for the betterment of the people of the Hospitality Industry by making their lives easier and by providing trusted and informative content. Thats why we are Hospitality Connaisseur.</span></h4>\r\n<p xss=\"removed\"><span xss=\"removed\"><br></span></p>\r\n<h4><span xss=\"removed\">Keep Learning. Keep Growing.</span></h4>'),
(30, 'tawk_plugin', '<!--Start of Tawk.to Script-->\r\n<script type=\"text/javascript\">\r\nvar Tawk_API=Tawk_API||{}, Tawk_LoadStart=new Date();\r\n(function(){\r\nvar s1=document.createElement(\"script\"),s0=document.getElementsByTagName(\"script\")[0];\r\ns1.async=true;\r\ns1.src=\'https://embed.tawk.to/5eb86f028ee2956d739fd390/default\';\r\ns1.charset=\'UTF-8\';\r\ns1.setAttribute(\'crossorigin\',\'*\');\r\ns0.parentNode.insertBefore(s1,s0);\r\n})();\r\n</script>\r\n<!--End of Tawk.to Script-->'),
